import React from 'react';
import HeaderProfile from './HeaderProfile.jsx';
import './ProFile.css';
import {Route, Switch} from 'react-router-dom';
import TimeLine from './TimeLine.jsx';
import Gallery from './Gallery.jsx';
import About from './About.jsx';
import Friends from './Friends.jsx';
import ActivityLog from './ActivityLog.jsx';

function MyProfile(){
  return (
    <>
      <div className="wrapper" >
        <HeaderProfile />
        <div className="profile-content" style={{margin: '20px 0'}}>
          <Route exact path="/:idProfile" component={TimeLine}/>
          <Route exact path="/:idProfile/timeline" component={TimeLine}/>
          <Route exact path="/:idProfile/friends" component={Friends}/>
          <Route exact path="/:idProfile/about" component={About}/>
          <Route exact path="/:idProfile/gallery" component={Gallery}/>
          <Route exact path="/:idProfile/activity-log" component={ActivityLog}/>
        </div>
      </div>
    </>
  )
}

export default MyProfile;
